import React, {useState} from 'react'
import {motion} from "framer-motion"

export default function Box1(){
    const [isAnimating,setIsAnimating] = useState(false);
    
    return(
        <div className="box-container">
            <motion.div  
            className='box'
            
            animate={{
                x:900,
                opacity: 1,
                rotate: 360
            }}
            initial={{
                opacity:0.5}}
            transition={{
                type: "spring",
                // duration:3
                stiffness:"150"
            }} 
            >


            </motion.div>

        </div>
    )
}
